INSERT INTO `tbl_article` (`ar_id`, `kw_id`, `uniq_id`, `cat_id`, `ar_summary`, `ar_title`, `ar_body`, `date_add`, `date_edit`, `ar_user_id`, `ar_show_public`, `ar_show_index`, `ar_read_count`, `last_view_ip`, `last_view_date`, `ar_post_by`, `ar_post_ip`, `ar_is_approve`) VALUES
(14, 14, 'GYK5FLT9DA4783395EIE30J4YNIJPTA49OPSY64H6X9JIM4M2H6S99DVB87QJ2TTZYHCAJJEJTHA7AFBR1R25GUW8CDD05B7JYIDSDK', 8, '<section id=\"article_summary\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-4\"><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/nCAkv61YMvUH9XADXuvcl9Jo9jDQKZ-c96gWul8vQWY6fNDLGX-A1p_L75CO83L8CNHMU0m6PFvQSsa217OuJOt_Qmvy7DEhzObFvUhz5bT5XaN9XrJZdrojnb3yG4El4kfq126zuwo=w2400\" />\r\n<p>เพชพระอุมา ตอน จอมผีดิบมันตรัย</p>\r\n</div>\r\n<div class=\"col-md-8\">\r\n<h1>ฟังนิยายเพชรพระอุมา จอมผีดิบมันตรัย</h1>\r\n<p class=\"text-center\"><strong> All Credit will be thanks to เครดิตให้ผู้เขียนนามปากกา \"พนมเทียน\" </strong></p>\r\n<p>&nbsp;</p>\r\n<div style=\"margin: 0 auto; border: 2px dashed #ff0000;\">\r\n<p class=\"text-center\"><br /><strong>ใช้เพื่อฟังส่วนตัวเท่านั้น!</strong> <span style=\"color: red; font-weight: bold;\">ไม่ได้มีเจตนาละเมิดลิขสิทธิ์แต่อย่างใด</span></p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p>จอมผีดิบมันตรัย <br />หนังสือเสียง เพชรพระอุมา <br />คุณศศวรรณ อรรถจรรยากุล <br />Edit Sound by Ubuntu 18.04 | Audacity | farookphuket | 20-Aug-2019</p>\r\n<p><strong>Copy Form youtube&nbsp;&nbsp;</strong> <a class=\"btn btn-primary\" style=\"color: white; font-weight: bold;\" href=\"https://www.youtube.com/channel/UCBOdKk8Fb_lT1wQhu8ftCDw\" target=\"_blank\" rel=\"noopener\"> ร้อยตํารวจเอก ปลอมตัวมา </a> <br />Published on Dec 3, 2017</p>\r\n<p>\"เพชรพระอุมา\" เป็นบทประพันธ์ของ \"พนมเทียน\" มีความยาวทั้งสิ้น 48 เล่ม<br />แบ่งออกเป็นสองภาค คือภาคแรกและภาคสมบูรณ์ ภาคละ 24 เล่ม เล่มละ 200 บาท<br />สั่งซื้อได้ตามร้านหนังสือทั่วไป</p>\r\n<p>ภาคแรกของเพชรพระอุมาแบ่งเป็น 6 ตอน ได้แก่ ไพรมหากาฬ, ดงมรณะ,<br />จอมผีดิบมันตรัย, อาถรรพณ์นิทรานคร, ป่าโลกล้านปี และแงซายจอมจักรา</p>\r\n<p>สำหรับภาคสมบูรณ์ก็แบ่งเป็น 6 ตอนเช่นกัน ได้แก่ จอมพราน,<br />ไอ้งาดำ, จิตรางคนางค์, นาคเทวี, แต่ปางบรรพ์ และมงกุฎไพร</p>\r\n<p>ห้องสมุดคอลฟิลด์เพื่อคนตาบอด ของมูลนิธิช่วยคนตาบอดแห่งประเทศไทย <br />ในพระบรมราชินูปถัมภ์ ได้นำมาจัดทำเป็นหนังสือเสียงทั้งสองภาค</p>\r\n<p>ภาคแรกมีอาสาสมัครช่วยกันอ่านสองท่าน คือ คุณศศวรรณ อรรถจรรยากุล<br />เริ่มอ่านจากตอนต้น ..ไพรมหากาฬ ต่อด้วย..ดงมรณะไปถึงช่วงกลางๆ<br />จากนั้นคุณดวงวิภา ยุทธสุริยพันธุ์ อ่านต่อในส่วนที่เหลือจนจบทั้งสองภาค</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>', 'ฟังนิยายเพชรพระอุมา จอมผีดิบมันตรัย', '<section id=\"ar_body\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-12\"><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/nCAkv61YMvUH9XADXuvcl9Jo9jDQKZ-c96gWul8vQWY6fNDLGX-A1p_L75CO83L8CNHMU0m6PFvQSsa217OuJOt_Qmvy7DEhzObFvUhz5bT5XaN9XrJZdrojnb3yG4El4kfq126zuwo=w2400\" />\r\n<p class=\"text-center\">Photo name</p>\r\n</div>\r\n<div class=\"col-lg-12\">\r\n<h1 class=\"tm-welcome-text\">\"ฟังนิยายเพชรพระอุมา จอมผีดิบมันตรัย\".</h1>\r\n</div>\r\n</div>\r\n<div class=\"row tm-section-mb\">\r\n<div class=\"col-lg-12\">\r\n<div class=\"col-lg-12\">\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 59 to 62</h1>\r\n<p><iframe src=\"https://archive.org/embed/59606162\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 5 ชั่วโมง 40 นาที 32 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 63 to 66</h1>\r\n<p><iframe src=\"https://archive.org/embed/63646566\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 5 ชั่วโมง 35 นาที 15 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 67 to 71</h1>\r\n<p><iframe src=\"https://archive.org/embed/6771_20190830\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 7 ชั่วโมง 15 นาที 58 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 72 to 74</h1>\r\n<p><iframe src=\"https://archive.org/embed/727374\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 4 ชั่วโมง 14 นาที 53 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 75 to 79</h1>\r\n<p><iframe src=\"https://archive.org/embed/7579_20190901\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 7 ชั่วโมง 26 นาที 31 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 80 to 84</h1>\r\n<p><iframe src=\"https://archive.org/embed/80to84\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 7 ชั่วโมง 14 นาที 26 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 85 ถึง 89</h1>\r\n<p><iframe src=\"https://archive.org/embed/85to89\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 7 ชั่วโมง 11 นาที 52 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 90 ถึง 95</h1>\r\n<p><iframe src=\"https://archive.org/embed/90to95\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 8 ชั่วโมง 40 นาที 47 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>วันนี้พอแค่นี้ก่อนนะครับ ผมจะมา Update ใหม่ให้อีกครั้งในวันที่ 15 ตุลาคม 2562 ครับ</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>', '2019-09-22 21:35:33', '2020-03-08 00:44:19', 14, 2, 2, 1055, '147.92.179.118', '2020-07-29', 'root', '1.46.110.80', 2),
(15, 15, 'DDA04T6IRQ6DBS8047BI9DJYB7H2ZKHL3TE53JPTJIJO9ATW4FY7Y2EGSNFH69X7A3J4P9MJC2U85TA9DSI85GM9YR1EJD45CAYJVHK', 8, '<div class=\"row\">\r\n<div class=\"col-lg-4\"><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/s2RNr270Kv4qx3ZsnLQcsl184NmadqcjGmSO8G5JVJyj_uZuLeHF8OD8O13RG8hnhs-QdbbnSZPEdFAjK3PYYzXB4FzV0_XP7iyHdb6b4GBMB9nbAQTzCnywcVQJdVRxzFLziBBJb7w=w2400\" />\r\n<p class=\"text-center\">ไพรมหากาฬ</p>\r\n</div>\r\n<div class=\"col-lg-8\">\r\n<p><strong> All Credit will be thanks to : </strong> ผู้เขียนนามปากกา \"พนมเทียน\" <br />นิยายเพชรพระอุมา ตอน ไพรมหากาฬ</p>\r\n<p>\"เพชรพระอุมา\" เป็นบทประพันธ์ของ \"พนมเทียน\" มีความยาวทั้งสิ้น 48 เล่ม<br />แบ่งออกเป็นสองภาค คือภาคแรกและภาคสมบูรณ์ ภาคละ 24 เล่ม เล่มละ 200 บาท<br />สั่งซื้อได้ตามร้านหนังสือทั่วไป</p>\r\n<p>ภาคแรกของเพชรพระอุมาแบ่งเป็น 6 ตอน ได้แก่ ไพรมหากาฬ, ดงมรณะ,<br />จอมผีดิบมันตรัย, อาถรรพณ์นิทรานคร, ป่าโลกล้านปี และแงซายจอมจักรา</p>\r\n<p>สำหรับภาคสมบูรณ์ก็แบ่งเป็น 6 ตอนเช่นกัน ได้แก่ จอมพราน,<br />ไอ้งาดำ, จิตรางคนางค์, นาคเทวี, แต่ปางบรรพ์ และมงกุฎไพร</p>\r\n<p>ห้องสมุดคอลฟิลด์เพื่อคนตาบอด ของมูลนิธิช่วยคนตาบอดแห่งประเทศไทย <br />ในพระบรมราชินูปถัมภ์ ได้นำมาจัดทำเป็นหนังสือเสียงทั้งสองภาค</p>\r\n<p>ภาคแรกมีอาสาสมัครช่วยกันอ่านสองท่าน คือ คุณศศวรรณ อรรถจรรยากุล<br />เริ่มอ่านจากตอนต้น ..ไพรมหากาฬ ต่อด้วย..ดงมรณะไปถึงช่วงกลางๆ<br />จากนั้นคุณดวงวิภา ยุทธสุริยพันธุ์ อ่านต่อในส่วนที่เหลือจนจบทั้งสองภาค</p>\r\n</div>\r\n</div>', 'เพชรพระอุมา ตอน ไพรมหากาฬ', '<section id=\"ar_body\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-12\"><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/s2RNr270Kv4qx3ZsnLQcsl184NmadqcjGmSO8G5JVJyj_uZuLeHF8OD8O13RG8hnhs-QdbbnSZPEdFAjK3PYYzXB4FzV0_XP7iyHdb6b4GBMB9nbAQTzCnywcVQJdVRxzFLziBBJb7w=w2400\" />\r\n<p class=\"text-center\">เพชรพระอุมา ตอน ไพรมหากาฬ</p>\r\n</div>\r\n<div class=\"col-lg-12\">\r\n<h1 class=\"tm-welcome-text\">\"ฟังนิยายเพชรพระอุมา ตอน ไพรมหากาฬ\".</h1>\r\n</div>\r\n</div>\r\n<div class=\"row tm-section-mb\">\r\n<div class=\"col-lg-12\">\r\n<div class=\"col-lg-12\">\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 1</h1>\r\n<p><iframe src=\"https://archive.org/embed/1_20190819_20190819_2324\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 1 ชั่วโมง 24 นาที 59 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 2</h1>\r\n<p><iframe src=\"https://archive.org/embed/2_20190820\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 1 ชั่วโมง 32 นาที 28 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 3</h1>\r\n<p><iframe src=\"https://archive.org/embed/3_20190821_20190821_1444\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 1 ชั่วโมง 33 นาที 05 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 4</h1>\r\n<p><iframe src=\"https://archive.org/embed/4_20190821_20190821_1510\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 1 ชั่วโมง 32 นาที 26 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 5</h1>\r\n<p><iframe src=\"https://archive.org/embed/5_20190821_20190821_1550\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 1 ชั่วโมง 33 นาที 00 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 6</h1>\r\n<p><iframe src=\"https://archive.org/embed/6_20190821_201908\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 1 ชั่วโมง 33 นาที 11 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 7</h1>\r\n<p><iframe src=\"https://archive.org/embed/7_20190821_20190821_2248\" width=\"500\" height=\"30\" framebor