ame></p>\r\n<p>ความยาว 6 ชั่วโมง 11 นาที 20 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<!-- item End --> <!-- Item Start -->\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 29</h1>\r\n<p><iframe src=\"https://archive.org/embed/294_20190825\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว&nbsp; 35 นาที 07 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<!-- item End --></ol>\r\n<p>&nbsp;</p>\r\n<p>จบเล่ม \"ไพรมหากาฬ\" ตอนต่อไป \"ดงมรณะ\"<br />เอาแค่นี้ก่อน เดี๋ยวอาทิตย์หน้า (วันจันทร์ ที่ 1 กันยา 2562 ) จะมาอัพเดตให้ใหม่จ้า</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>', '2019-09-22 21:54:23', '2020-02-19 06:26:03', 14, 2, 2, 742, '182.232.215.241', '2020-07-29', 'root', '1.46.110.80', 2),
(16, 16, '24DHKGAV5H719I8AJ6BM3YIWY7JIKJPH4YCHI304T4JJTE5R5RGNBCJZ0UJE3TOA69QJPT5DDYBE99XDL2A7848SSA9SF29MD7FYTD6', 8, '<!--summary start-->\r\n<section id=\"article_summary\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-4\"><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/tsOd3oGP_IwJvUS9aPouBiie_GL3ChLTgzvlqkg-DFSydcKYiRGf3hzShqFx4c_WtT6xTiTmGDXvJZ9VRkk7Ds0VEeSZMefpjWk4FuoKEDDtgcdGk4JvEZHres4c5fWcmVcYvtaTiGo=w2400\" />\r\n<p>เพชพระอุมา ตอน ดงมรณะ</p>\r\n</div>\r\n<div class=\"col-md-8\">\r\n<h1>เพชรพระอุมา ตอน ดงมรณะ</h1>\r\n<p class=\"text-center\"><strong> All Credit will be thanks to เครดิตให้ผู้เขียนนามปากกา \"พนมเทียน\" </strong></p>\r\n<p>&nbsp;</p>\r\n<div style=\"margin: 0 auto; border: 2px dashed #ff0000;\">\r\n<p class=\"text-center\"><br /><strong>ใช้เพื่อฟังส่วนตัวเท่านั้น!</strong> <span style=\"color: red; font-weight: bold;\">ไม่ได้มีเจตนาละเมิดลิขสิทธิ์แต่อย่างใด</span></p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p>ไพรมหากาฬ <br />หนังสือเสียง เพชรพระอุมา <br />คุณศศวรรณ อรรถจรรยากุล <br />Edit Sound by Ubuntu 18.04 | Audacity | farookphuket | 20-Aug-2019</p>\r\n<p><strong>Copy Form youtube&nbsp;&nbsp;</strong> <a class=\"btn btn-primary\" style=\"color: white; font-weight: bold;\" href=\"https://www.youtube.com/channel/UCBOdKk8Fb_lT1wQhu8ftCDw\" target=\"_blank\" rel=\"noopener\"> ร้อยตํารวจเอก ปลอมตัวมา </a> <br />Published on Dec 3, 2017</p>\r\n<p>\"เพชรพระอุมา\" เป็นบทประพันธ์ของ \"พนมเทียน\" มีความยาวทั้งสิ้น 48 เล่ม<br />แบ่งออกเป็นสองภาค คือภาคแรกและภาคสมบูรณ์ ภาคละ 24 เล่ม เล่มละ 200 บาท<br />สั่งซื้อได้ตามร้านหนังสือทั่วไป</p>\r\n<p>ภาคแรกของเพชรพระอุมาแบ่งเป็น 6 ตอน ได้แก่ ไพรมหากาฬ, ดงมรณะ,<br />จอมผีดิบมันตรัย, อาถรรพณ์นิทรานคร, ป่าโลกล้านปี และแงซายจอมจักรา</p>\r\n<p>สำหรับภาคสมบูรณ์ก็แบ่งเป็น 6 ตอนเช่นกัน ได้แก่ จอมพราน,<br />ไอ้งาดำ, จิตรางคนางค์, นาคเทวี, แต่ปางบรรพ์ และมงกุฎไพร</p>\r\n<p>ห้องสมุดคอลฟิลด์เพื่อคนตาบอด ของมูลนิธิช่วยคนตาบอดแห่งประเทศไทย <br />ในพระบรมราชินูปถัมภ์ ได้นำมาจัดทำเป็นหนังสือเสียงทั้งสองภาค</p>\r\n<p>ภาคแรกมีอาสาสมัครช่วยกันอ่านสองท่าน คือ คุณศศวรรณ อรรถจรรยากุล<br />เริ่มอ่านจากตอนต้น ..ไพรมหากาฬ ต่อด้วย..ดงมรณะไปถึงช่วงกลางๆ<br />จากนั้นคุณดวงวิภา ยุทธสุริยพันธุ์ อ่านต่อในส่วนที่เหลือจนจบทั้งสองภาค</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<!-- End Of Summary -->', 'หนังสือเสียง เพชรพระอุมา ตอน ดงมรณะ', '<!-- BODY START -->\r\n<section id=\"article_body\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-12\">\r\n<h1 class=\"text-center\">เพชรพระอุมา ตอน ดงมรณะ</h1>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"col-lg-12\">\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 30-31-32</h1>\r\n<p><iframe src=\"https://archive.org/embed/001longplay530hrs303132\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 5 ชั่วโมง 31 นาที 45 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 33-34-35-36</h1>\r\n<p><iframe src=\"https://archive.org/embed/longplay6hrs33343536\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 6 ชั่วโมง 11 นาที 22 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 37-38-39</h1>\r\n<p><iframe src=\"https://archive.org/embed/longplay4hrs373839\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 4 ชั่วโมง 39 นาที 59 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 40-41-42-43</h1>\r\n<p><iframe src=\"https://archive.org/embed/longplay6hrs40414243\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 6 ชั่วโมง 08 นาที 46 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 44-45-46-47</h1>\r\n<p><iframe src=\"https://archive.org/embed/longplay6hrs44454647\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 6 ชั่วโมง 10 นาที 41 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 48-49-50-51</h1>\r\n<p><iframe src=\"https://archive.org/embed/longplay5hrs48495051\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 5 ชั่วโมง 53 นาที 32 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 52 ถึง 57</h1>\r\n<p><iframe src=\"https://archive.org/embed/longplay8hrs5257\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 8 ชั่วโมง 19 นาที 45 วินาที คลิปนี้ยาวที่สุดเริ่มสร้างเมื่อ 28-สิงหาคม-2562</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 58 จบตอน ดงมรณะ</h1>\r\n<p><iframe src=\"https://archive.org/embed/58_20190828\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 1 ชั่วโมง 27 นาที 14 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>จบตอน \"ดงมรณะ\" ตอนต่อไป \"จอมผีดิบมันตรัย\" <br />จบตอนแล้วนะครับ ผมจะมา Update ใหม่ให้อีกครั้งในวันที่ 25 กันยายน 2562 ครับ</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<!-- END BODY -->', '2019-09-22 22:30:08', '2020-02-19 06:28:48', 14, 2, 0, 2008, '223.24.153.41', '2020-07-29', 'root', '1.46.110.80', 2),
(17, 17, 'GAA8ICMIJ95AB7W6YE3M6YTN44KJS7LEA0HHSJ99Z975I4KJATDDTOFYT2PR35H05FGJ2BDDYJYES2XP4B8QJ6C9R3VHDT7DU148J9I', 8, '<!--summary start-->\r\n<section id=\"article_summary\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-4\"><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/YnmtFpAJ37zkuQTcyw-v6KHh07HFJdiFuF6WkTnx3tUX2WIdrY_hwJzGs8jXyrc_-jaY40prXfYaavlH_yoFyNjpgUq5N0yiFIEy1Qbwm_NJ4QsX6CB4WJVXBOsaIlGN8sGmPfo_KAo=w2400\" />\r\n<p>เพชพระอุมา ตอน อาถรรพณ์นิทรานคร</p>\r\n</div>\r\n<div class=\"col-md-8\">\r\n<h1>เพชรพระอุมา ตอน อาถรรพณ์นิทรานคร</h1>\r\n<p class=\"text-center\"><strong> All Credit will be thanks to เครดิตให้ผู้เขียนนามปากกา \"พนมเทียน\" </strong> <a class=\"btn btn-primary btn-xs\" style=\"color: white; font-weight: bold;\" href=\"https://th.wikipedia.org/wiki/%E0%B9%80%E0%B8%9E%E0%B8%8A%E0%B8%A3%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B8%AD%E0%B8%B8%E0%B8%A1%E0%B8%B2\" target=\"_blank\" rel=\"noopener\">เพชรพระอุมาวิกิพีเดีย</a></p>\r\n<p>&nbsp;</p>\r\n<div style=\"margin: 0 auto; border: 2px dashed #ff0000;\">\r\n<p class=\"text-center\"><br /><strong>ใช้เพื่อฟังส่วนตัวเท่านั้น!</strong> <span style=\"color: red; font-weight: bold;\"> ไม่ได้มีเจตนาละเมิดลิขสิทธิ์แต่อย่างใด </span></p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p>ผู้ประพันธ์ นายฉัตรชัย วิเศษสุวรรณภูมิ (พนมเทียน)</p>\r\n<p>ตอน อาถรรพณ์นิทรานคร หนังสือเสียง เพชรพระอุมา <br />ดวงวิภา ยุทธสุริยพันธุ์ <br />Edit Sound by Ubuntu 18.04 | Audacity | farookphuket | 5-Sep-2019</p>\r\n<p>ภาคแรกของเพชรพระอุมาแบ่งเป็น 6 ตอน ได้แก่ ไพรมหากาฬ, ดงมรณะ,<br />จอมผีดิบมันตรัย, อาถรรพณ์นิทรานคร, ป่าโลกล้านปี และแงซายจอมจักรา</p>\r\n<p>สำหรับภาคสมบูรณ์ก็แบ่งเป็น 6 ตอนเช่นกัน ได้แก่ จอมพราน,<br />ไอ้งาดำ, จิตรางคนางค์, นาคเทวี, แต่ปางบรรพ์ และมงกุฎไพร</p>\r\n<p>\"เพชรพระอุมา\" เป็นบทประพันธ์ของ \"พนมเทียน\" มีความยาวทั้งสิ้น 48 เล่ม<br />แบ่งออกเป็นสองภาค คือภาคแรกและภาคสมบูรณ์ ภาคละ 24 เล่ม เล่มละ 200 บาท<br />สั่งซื้อได้ตามร้านหนังสือทั่วไป</p>\r\n<p>ห้องสมุดคอลฟิลด์เพื่อคนตาบอด ของมูลนิธิช่วยคนตาบอดแห่งประเทศไทย <br />ในพระบรมราชินูปถัมภ์ ได้นำมาจัดทำเป็นหนังสือเสียงทั้งสองภาค</p>\r\n<p>ภาคแรกมีอาสาสมัครช่วยกันอ่านสองท่าน คือ คุณศศวรรณ อรรถจรรยากุล<br />เริ่มอ่านจากตอนต้น ..ไพรมหากาฬ ต่อด้วย..ดงมรณะไปถึงช่วงกลางๆ<br />จากนั้นคุณดวงวิภา ยุทธสุริยพันธุ์ อ่านต่อในส่วนที่เหลือจนจบทั้งสองภาค</p>\r\n<p><strong>Copy Form youtube&nbsp;&nbsp;</strong> <a class=\"btn btn-primary\" style=\"color: white; font-weight: bold;\" href=\"https://www.youtube.com/channel/UCBOdKk8Fb_lT1wQhu8ftCDw\" target=\"_blank\" rel=\"noopener\"> ร้อยตํารวจเอก ปลอมตัวมา </a> <br />Published on Dec 3, 2017</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<!-- End Of Summary -->\r\n<p>&nbsp;</p>', 'ฟังนิยายเพชรพระอุมา ตอน อาถรรพณ์นิทรานคร', '<!-- BODY START -->\r\n<section id=\"article_body\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-4\"><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/YnmtFpAJ37zkuQTcyw-v6KHh07HFJdiFuF6WkTnx3tUX2WIdrY_hwJzGs8jXyrc_-jaY40prXfYaavlH_yoFyNjpgUq5N0yiFIEy1Qbwm_NJ4QsX6CB4WJVXBOsaIlGN8sGmPfo_KAo=w2400\" /></div>\r\n<div class=\"col-lg-8\">\r\n<h1 class=\"text-center\">เพชรพระอุมา ตอน อาถรรพณ์นิทรานคร</h1>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"col-lg-12\">\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 101 ถึง 107</h1>\r\n<p>&nbsp;</p>\r\n<p><iframe src=\"https://archive.org/embed/101to107\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 9 ชั่วโมง 58 นาที 20 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>\r\n<div class=\"container\">\r\n<p>&nbsp;</p>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 108 - 114</h1>\r\n<p>&nbsp;</p>\r\n<p><iframe src=\"https://archive.org/embed/108to114\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 9 ชั่วโมง 55 นาที 41 วินาที</p>\r\n<p>date on Thu Sep 2019 3:05 a.m. upload this sound clip.</p>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"container\">\r\n<p>&nbsp;</p>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 115 - 120</h1>\r\n<p>&nbsp;</p>\r\n<p><iframe src=\"https://archive.org/embed/115to120\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 8 ชั่วโมง 27 นาที 45 วินาที</p>\r\n<p>date on Thu Sep 2019 3:05 a.m. upload this sound clip.</p>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"container\">\r\n<h1 class=\"text-center\">คลิปเสียงที่ 121 - 125</h1>\r\n<p><iframe src=\"https://archive.org/embed/121to125\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 7 ชั่วโมง 54 นาที 29 วินาที</p>\r\n<p>จบตอน</p>\r\n</div>\r\n</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>จบตอน \"อาถรรพณ์นิทรานคร\" และตอนต่อไป \"ป่าโลกล้านปี\"</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<!-- END BODY -->\r\n<p>&nbsp;</p>', '2019-09-22 22:45:02', '2020-02-19 06:28:30', 14, 2, 0, 692, '58.11.83.119', '2020-07-29', 'root', '1.46.110.80', 2),
(18, 18, '28SH7T1SMECOABJI44JEJK2P8DIDHD9XJN5P2J3T66JYI5A9T039949B9YJ6YDCF4Q0YFT3S5GGHMH75VJRW8B77ADYTRIDEAKLUA4Z', 8, '<!--summary start-->\r\n<section id=\"article_summary\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-4\"><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/ZIgwIy7a236RWNjgleQgOUYd0fNCljhOahL7zEtvgiNV8rc3zPOgUpXl1KDR2dyplSqGHr48c3ItmrA3FEnVwUJidCGq8d8-68fuLvVVQ6aWNDUNYZ3NmnzW8zy_T0XdgC6WlpNqiaI=w2400\" />\r\n<p>เพชพระอุมา ตอน ป่าโลกล้านปี</p>\r\n</div>\r\n<div class=\"col-md-8\">\r\n<h1>เพชรพระอุมา ตอน ป่าโลกล้านปี</h1>\r\n<p class=\"text-center\"><strong> All Credit will be thanks to เครดิตให้ผู้เขียนนามปากกา \"พนมเทียน\" </strong> <a class=\"btn btn-primary btn-xs\" style=\"color: white; font-weight: bold;\" href=\"https://th.wikipedia.org/wiki/%E0%B9%80%E0%B8%9E%E0%B8%8A%E0%B8%A3%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B8%AD%E0%B8%B8%E0%B8%A1%E0%B8%B2\" target=\"_blank\" rel=\"noopener\">เพชรพระอุมาวิกิพีเดีย</a></p>\r\n<p>&nbsp;</p>\r\n<div style=\"margin: 0 auto; border: 2px dashed #ff0000;\">\r\n<p class=\"text-center\"><br /><strong>ใช้เพื่อฟังส่วนตัวเท่านั้น!</strong> <span style=\"color: red; font-weight: bold;\"> ไม่ได้มีเจตนาละเมิดลิขสิทธิ์แต่อย่างใด </span></p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p>ผู้ประพันธ์ นายฉัตรชัย วิเศษสุวรรณภูมิ (พนมเทียน)</p>\r\n<p>ตอน ป่าโลกล้านปี หนังสือเสียง เพชรพระอุมา <br />ดวงวิภา ยุทธสุริยพันธุ์ <br />Edit Sound by Ubuntu 18.04 | Audacity | farookphuket | 5-Sep-2019</p>\r\n<p>ภาคแรกของเพชรพระอุมาแบ่งเป็น 6 ตอน ได้แก่ ไพรมหากาฬ, ดงมรณะ,<br />จอมผีดิบมันตรัย, อาถรรพณ์นิทรานคร, ป่าโลกล้านปี และแงซายจอมจักรา</p>\r\n<p>สำหรับภาคสมบูรณ์ก็แบ่งเป็น 6 ตอนเช่นกัน ได้แก่ จอมพราน,<br />ไอ้งาดำ, จิตรางคนางค์, นาคเทวี, แต่ปางบรรพ์ และมงกุฎไพร</p>\r\n<p>\"เพชรพระอุมา\" เป็นบทประพันธ์ของ \"พนมเทียน\" มีความยาวทั้งสิ้น 48 เล่ม<br />แบ่งออกเป็นสองภาค คือภาคแรกและภาคสมบูรณ์ ภาคละ 24 เล่ม เล่มละ 200 บาท<br />สั่งซื้อได้ตามร้านหนังสือทั่วไป</p>\r\n<p>ห้องสมุดคอลฟิลด์เพื่อคนตาบอด ของมูลนิธิช่วยคนตาบอดแห่งประเทศไทย <br />ในพระบรมราชินูปถัมภ์ ได้นำมาจัดทำเป็นหนังสือเสียงทั้งสองภาค</p>\r\n<p>ภาคแรกมีอาสาสมัครช่วยกันอ่านสองท่าน คือ คุณศศวรรณ อรรถจรรยากุล<br />เริ่มอ่านจากตอนต้น ..ไพรมหากาฬ ต่อด้วย..ดงมรณะไปถึงช่วงกลางๆ<br />จากนั้นคุณดวงวิภา ยุทธสุริยพันธุ์ อ่านต่อในส่วนที่เหลือจนจบทั้งสองภาค</p>\r\n<p><strong>Copy Form youtube&nbsp;&nbsp;</strong> <a class=\"btn btn-primary\" style=\"color: white; font-weight: bold;\" href=\"https://www.youtube.com/channel/UCBOdKk8Fb_lT1wQhu8ftCDw\" target=\"_blank\" rel=\"noopener\"> ร้อยตํารวจเอก ปลอมตัวมา </a> <br />Published on Dec 3, 2017</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<!-- End Of Summary -->\r\n<p>&nbsp;</p>', 'ฟังนิยายเพชรพระอุมา ตอน ป่าโลกล้านปี', '<!-- BODY START -->\r\n<section id=\"article_body\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-4\"><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/ZIgwIy7a236RWNjgleQgOUYd0fNCljhOahL7zEtvgiNV8rc3zPOgUpXl1KDR2dyplSqGHr48c3ItmrA3FEnVwUJidCGq8d8-68fuLvVVQ6aWNDUNYZ3NmnzW8zy_T0XdgC6WlpNqiaI=w2400\" /></div>\r\n<div class=\"col-lg-8\">\r\n<h1 class=\"text-center\">เพชรพระอุมา ตอน อาถรรพณ์นิทรานคร</h1>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"col-lg-12\">\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 126 ถึง 131</h1>\r\n<p>&nbsp;</p>\r\n<p><iframe src=\"https://archive.org/embed/126to131\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 7 ชั่วโมง 40 นาที 35 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>\r\n<div class=\"container\">\r\n<p>&nbsp;</p>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 132 - 136</h1>\r\n<p>&nbsp;</p>\r\n<p><iframe src=\"https://archive.org/embed/13213626sep2019\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 6 ชั่วโมง 34 นาที 19 วินาที</p>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"container\">\r\n<p>&nbsp;</p>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 137 - 145</h1>\r\n<p>&nbsp;</p>\r\n<p><iframe src=\"https://archive.org/embed/137to145\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 7 ชั่วโมง 57 นาที 14 วินาที</p>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"container\">\r\n<h1 class=\"text-center\">คลิปเสียงที่ 146 - 160</h1>\r\n<p><iframe src=\"https://archive.org/embed/146146160shortclip\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 6 ชั่วโมง 55 นาที 09 วินาที</p>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"container\">\r\n<h1 class=\"text-center\">คลิปเสียงที่ 161 - 177</h1>\r\n<p><iframe src=\"https://archive.org/embed/1611777hrs48min\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 7 ชั่วโมง 48 นาที 02 วินาที</p>\r\n</div>\r\n</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>ผมต้องขอโทษแฟนๆ นิยาย ทุกๆ ท่านจริงๆ ครับ ผมไม่สามารถหาคลิปเสียงได้ เนื่องด้วยคลิปทาง youtube ช่องที่ผมทำ Link มานั้นโดนลบไปแล้ว ผมคิดว่ามันน่าจะโดนเจ้าของลิขสิทธิ์เค้าแจ้งลบนะครับ คลิปเสียงเหล่านี้ที่อยู่ในเวปนี้ หรือตัวเวปไซต์นี้เอง ก็อาจจะโดนลบในเร็วๆ นี้แหละครับ แต่ผมก็ขอ \"ยืนยัน\" ตรงนี้อีกทีว่า ผมไม่ได้มีเจตนากระทำผิดกฎหมาย หากนี่ถือเป็นการ \"ละเมิดลิขสิทธิ์\" เพราะว่าผมไม่ได้ทำ หรือใช้ประโยชน์ใดๆ จากคลิปเหล่านี้เพื่อแสวงหากำไรใดๆ เลย นอกจากเอาไว้ \"ฟังเพื่อความบันเทิงส่วนตัว\" เท่านั้น</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<!-- END BODY -->\r\n<p>&nbsp;</p>', '2019-11-27 07:44:29', '2020-02-19 06:28:10', 14, 2, 0, 317, '66.249.79.201', '2020-07-29', 'root', '1.46.227.206', 2),
