>\r\n<p>ห้องสมุดคอลฟิลด์เพื่อคนตาบอด ของมูลนิธิช่วยคนตาบอดแห่งประเทศไทย <br />ในพระบรมราชินูปถัมภ์ ได้นำมาจัดทำเป็นหนังสือเสียงทั้งสองภาค</p>\r\n<p>ภาคแรกมีอาสาสมัครช่วยกันอ่านสองท่าน คือ คุณศศวรรณ อรรถจรรยากุล<br />เริ่มอ่านจากตอนต้น ..ไพรมหากาฬ ต่อด้วย..ดงมรณะไปถึงช่วงกลางๆ<br />จากนั้นคุณดวงวิภา ยุทธสุริยพันธุ์ อ่านต่อในส่วนที่เหลือจนจบทั้งสองภาค</p>\r\n<p><strong>Copy Form youtube&nbsp;&nbsp;</strong> <a class=\"btn btn-primary\" style=\"color: white; font-weight: bold;\" href=\"https://www.youtube.com/channel/UCBOdKk8Fb_lT1wQhu8ftCDw\" target=\"_blank\" rel=\"noopener\"> ร้อยตํารวจเอก ปลอมตัวมา </a> <br />Published on Dec 3, 2017</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<!-- End Of Summary -->\r\n<p>&nbsp;</p>', 'หนังสือเสียง เพชรพระอุมา ตอน แงซายจอมจักรา', '<!-- BODY START -->\r\n<section id=\"article_body\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-4\"><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/4tvx-1KweyJKTcPJ2fSGJgNohJGUXm3NF-2ndWs31040uuitG0peKaGSDAItsqW4TkQtwq2wugtvCr_l5OkVmqxmUgID2J_0OtNZARqu9J9eI__XGWaA5S8_yMYKkai6utpH1yw1HtE=w2400\" /></div>\r\n<div class=\"col-lg-8\">\r\n<h1 class=\"text-center\">เพชรพระอุมา ตอน แงซายจอมจักรา 15-3-2020</h1>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"col-lg-12\">\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 217 ถึง 244</h1>\r\n<p>&nbsp;</p>\r\n<p><iframe src=\"https://archive.org/embed/217to224\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 9 ชั่วโมง 55 นาที 39 วินาที</p>\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>\r\n<div class=\"container\">\r\n<p>&nbsp;</p>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 225 - 230</h1>\r\n<p>&nbsp;</p>\r\n<p><iframe src=\"https://archive.org/embed/225-to-230\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 7 ชั่วโมง 27 นาที 51 วินาที</p>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"container\">\r\n<p>&nbsp;</p>\r\n<h1 class=\"text-center\">คลิปเสียงที่ 231 - 237</h1>\r\n<p>&nbsp;</p>\r\n<p><iframe src=\"https://archive.org/embed/231-to-237\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 8 ชั่วโมง 09 นาที 10 วินาที</p>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"container\">\r\n<h1 class=\"text-center\">คลิปเสียงที่ 238 - 244</h1>\r\n<p><iframe src=\"https://archive.org/embed/238to244\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 8 ชั่วโมง 11 นาที 54 วินาที</p>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"container\">\r\n<h1 class=\"text-center\">คลิปเสียงที่ 245 - 249</h1>\r\n<p><iframe src=\"https://archive.org/embed/245to249\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 6 ชั่วโมง 17 นาที 54 วินาที</p>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"container\">\r\n<h1 class=\"text-center\">คลิปเสียงที่ 250 - 257</h1>\r\n<p><iframe src=\"https://archive.org/embed/250-to-257\" width=\"500\" height=\"30\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>ความยาว 8 ชั่วโมง 18 นาที 18 วินาที</p>\r\n</div>\r\n</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>จบภาคแรก \"แงซายจอมจักรา\" แล้วล่ะครับ ซึ่งตัวผมเอง ผมก็ไม่รู้ว่ามันขาดไปตอนไหนบ้าง แต่น่าจะขาดหลายตอนอยู่ ถ้าแฟนๆ นิยายเรื่องนี้ท่านใด มีไฟล์เสียงก็ขอความอนุเคราะห์ด้วยครับ เดี๋ยวภาคสองผมจะมา Update อีกครั้งในวันที่ 1 สิงหาคม 2563 ครับ</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<!-- END BODY -->\r\n<p>&nbsp;</p>', '2019-12-14 14:44:39', '2020-02-19 06:14:54', 14, 2, 2, 109, '223.24.170.101', '2020-07-28', 'root', '1.47.37.52', 2),
(22, 22, 'IJIB5HHFEJ9DTT7DZIYM4HQMKB45D8ADCI1K573YGAUJ29S6LP0726SSFYA2CRBTE4JOPTY3JH99NGV7YJE5JA9A4906DJ34TX8RWD8', 8, '<div class=\"row\">\r\n<div class=\"col-md-4\"><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/HPXWiCM9vjDwwgj7pyk8bS3AuYPw3xDKiN-GY2ush77QjbYkDaugpkKoUH4il2PDWyz8xaN_lad-d0apnAlLlYmdVBJB2iW87B2NLYpGJQOqitwXYKvkiJUXOy4_DULfxkxaeEOpvA=w2400\" /></div>\r\n<div class=\"col-md-8\">\r\n<p><strong> Have you ever </strong> have this feeling?</p>\r\n<p>How can I \"Zoom-in Zoom-out\" my screen on on my Ubuntu Mate 18.04 ?</p>\r\n<p><strong>In</strong> this POST we will see it so please just follow along if you are on <strong>Ubuntu Mate 18.04</strong>.</p>\r\n</div>\r\n</div>', 'how to \"Zoom-In\" and \"Zoom-out\" in Ubuntu Mate 18.04', '<!-- content start -->\r\n<section id=\"article_content\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-12\">\r\n<h1 class=\"text-center\">To Zoom-in Zoom-out on Ubuntu Mate 18.04</h1>\r\n<p>it\'s very simple but before we do that let check ourself first!</p>\r\n</div>\r\n<div class=\"col-lg-12\"><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/8deWuwKnLqA6jLnzzaIoMTRX9F9xj2p5JL_nJWVlgDrOng84nJ_V_7Zje1FK_I5tfXoxzLQd77K07FzTcDl6OGQ3rMjPiBYZvUhrXdbHJyt3klX-0BqWYhQnhiX3TzidhtlzXv64sA=w2400\" />\r\n<p class=\"text-center\">Click \"Menu\" then type in \"<strong>Tweak</strong>\"</p>\r\n<p>&nbsp;</p>\r\n<img class=\"responsive\" src=\"https://lh3.googleusercontent.com/f3gP6tTbJYj00Y8C9V3snLsG3sImH7hkcVSymU5Exxzruh4GuZCW0JTfuaYtmVbxbLvhs4zqUfym4LJ3cx0f-YvKyOT-OTw7hhAqQXdpvTucaodZA06gBbD8kAtwl6ik7ihDGkCdAg=w2400\" />\r\n<p class=\"text-center\">Then select \"Window\" and make sure there is \"<strong>Compiz Advance GPU acelerated desktop effects</strong>\" is selected if not so,just select it.</p>\r\n<p>That\'s all you have to do and to using it, it is very simple by press the <strong>super key+mouse</strong> scroll in to zoom-in and <strong>Super Key+mouse</strong> scroll out to zoom-out.</p>\r\n<p><strong>P.S.</strong> <br /><strong>Super Key</strong> is your <strong>Window Key</strong></p>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div class=\"col-lg-12\">\r\n<h1 class=\"text-center\">Video(in Thai speaking)</h1>\r\n<p class=\"text-center\">คือแบบว่าขี้เกียจทำวิดิโออีกอันเป็นพูดปะกิดน่ะ ก็เลย....</p>\r\n<p>&nbsp;</p>\r\n<div class=\"video-container\"><iframe src=\"https://www.youtube.com/embed/6Z7wCiAU9_Y\" width=\"560\" height=\"315\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n<p class=\"text-center\"><strong>If you could speak Thai</strong> so you will understand me.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<!-- Content END -->', '2019-12-14 17:11:26', '2020-02-07 05:19:41', 14, 2, 2, 75, '66.249.71.43', '2020-07-29', 'root', '1.47.37.52', 2),
(23, 24, '99YY17IY4CA064B0KT3JJ7N22H8IU6E7OV48C94TXA2RD9DO1TE95IF4RUUAD70HY7A5YCM8JAY26DOJJ50VDA2L7SBD937SUS1RVMFTY3OP6H4FP6EPT4RJWAPVTDTI893D5CBPBZCQGJBEEY85K3598TAD3RG6B05FEH291JF4', 8, '<div class=\"container\">\r\n<div class=\"row\"><!-- row 1 -->\r\n<div class=\"col-lg-12\">\r\n<h1 class=\"text-center\">trip to Chiang-Mai on 2-2-2018</h1>\r\n<p><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/ls2qQeEPmBdXVv6xtuBBNcqll-TYGRgvYgFwUV50eh2DmhoeRf9mpJ6PY4jAPhFQ-5-q3ZHhvxP7hv5KSgkVleHnHNhT2yc37Mwt6VUgrIpbzBIazZmI1hBPNTKob7Ylm7qZk2XR-9k=w2400\" alt=\"keep it a momory 2-2-2018\" /></p>\r\n<p>Chiang-Mai trip</p>\r\n<div class=\"float-right\">\r\n<p>ยังจำกันได้มั้ย? ตดกันทั้งงาน</p>\r\n</div>\r\n</div>\r\n<!-- END ROW1--></div>\r\n</div>', 'get my old day back(2-Feb-2018)', '<div class=\"container\">\r\n<div class=\"row\"><!-- ROW1-->\r\n<div class=\"col-lg-12\">\r\n<h1 class=\"text-center\">ยังจำกันได้มั้ย?</h1>\r\n<p>ทริปนั้นไงที่เราไปกันสองคัน ไปเขียงใหม่กันไง ที่ \"ตด\" กันทั้งงานเลยน่ะ อย่ามาพูดว่าจำไม่ได้ ยังเหม็นไม่หายเลย \"ตดยังไม่ทันหายเหม็น\" ไง</p>\r\n<p><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/57-4lBxkg5lLEiQolnGED3QXO4FawLN8LDu_ncZjK0Ryrlx2diEUDZIT5RciqZx46nq4l2g7mQZcrGQmRDwV7z0Hnhpf120Harc4h9Kje7VVdJAoos6pdQ_4RBFzMCaGuN5CdF9d-Nk=w2400\" alt=\"ทริปนี้ มีแต่ตด\" /></p>\r\n<p class=\"text-center\">อันนี้รูปเอามาประกอบเฉยๆ นะ ไม่ได้เกี่ยวอะไรกับเนื้อเรื่องเล้ยยย</p>\r\n</div>\r\n<!-- END OF ROW1--> <!-- ROW2-->\r\n<div class=\"col-lg-12\">\r\n<div class=\"video-container\"><iframe src=\"https://www.youtube.com/embed/PJ9ZzOra6RQ\" width=\"560\" height=\"315\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n<p class=\"text-center\">\"คนอื่นเค้านอนกันลำบากแทบตาย มีแต่บังรุคขับรถสบายอยู่คนเดียว\" ไอ้เต้ว่า</p>\r\n<p>ขาไปมีเรื่องเสียวๆ ด้วยนะ เสียดายว่ากล้องมันอัดไว้ไม่ได้ มีรถลอยข้ามหัวพวกเราไปแบบในหนัง ยังไงยังงั้นเลย</p>\r\n<p>เดี๋ยวมีคลิปอื่นๆ หรือว่าหารูปเจอจะเอามาลงให้ใหม่นะครับ วันนี้พอก่อน</p>\r\n</div>\r\n<!-- END of Row2--></div>\r\n</div>', '2020-03-02 23:47:30', '2020-03-02 23:58:06', 14, 2, 2, 217, '40.77.167.232', '2020-07-27', 'far_yahoo', '1.46.204.30', 2),
(24, 25, 'RT2J0O7I7M9KDVETYJN4C91AT7AEDBG59FMD6JD99R6CJ4TYBTYFOD99A7VHC2U10I3JVB40T4A61P8KDT68PGTI2Y3Z3P4I7WLD3PYC80E8D9FF56SQ52C3503FSJEA15US54EYBYU6OPRADA8879447EJXRHOHVYA5JB2RUHB2', 8, '<div class=\"container\">\r\n<div class=\"row\"><!-- row 1 -->\r\n<div class=\"col-lg-12\">\r\n<h1 class=\"text-center\">John Gray\'s Good morning 20</h1>\r\n<p>Hello every body this page is about an introduction of the brand new tour program from \"John Gray\'s Sea Canoe\" code name \"John Gray\'s Good Morning20\"</p>\r\n<p><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/lWQrPUDqZVcWdi2hTDWuKTgJK--iuE66Oyg7RZxgd0FtWDVqpFNSm7nEg69Lid8GySmmg-UxNkjEPMvAZfT2EaVhBOkl5tSWQZPtu4fEa2zbTjTLQ8pfJw-Jkor2F0LMGKC_AOalCNs=w2400\" alt=\"just for set the template\" /></p>\r\n<p>was a beauty of Andaman sea</p>\r\n</div>\r\n<!-- END ROW1--></div>\r\n</div>', 'the introduction of \"John Gray\'s good morning 20\"', '<div class=\"container\">\r\n<div class=\"row\"><!-- ROW1-->\r\n<div class=\"col-lg-12\">\r\n<h1 class=\"text-center\">The beauty of the Andaman Sea,Thailand</h1>\r\n<p>Hello every body \"John Gray\'s Sea Canoe\" just has an introduction of a brand new tour program in Phang-Nga bay this year code name <span style=\"color: green;\"> <strong> John Gray\'s Good Morning 20 </strong></span> which will do operate as the morning program as it code name said</p>\r\n<p style=\"text-align: center;\">I just made a small title of this just to introdue to all of you who may want to see.</p>\r\n<p><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/kQF_byCMz9UKe6azElIbZYUGTHeJKImwHrhmuHQgMp0TaznOIKYSyNP5wzuOfawMMmVjucvWK_H7mEN2Uu8fbYeB5tCA3b6AWCjNPfcSU_0kALb31k9UfuFhoAdbbqfQVgAKGIUtDfg=w2400\" alt=\"content row 1\" /></p>\r\n</div>\r\n<!-- END OF ROW1--> <!-- ROW2-->\r\n<div class=\"col-lg-12\">\r\n<div class=\"video-container\"><iframe src=\"https://www.youtube.com/embed/uaOo_fkNzz4\" width=\"560\" height=\"315\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n<p class=\"text-center\">an introduction of \"John Gray\'s Good morning 20\" a brand new tour program from John Gray Sea Canoe</p>\r\n<p class=\"pt-4\">&nbsp;</p>\r\n</div>\r\n<!-- set sub title section as 2 column START-->\r\n<div class=\"col-lg-6\">\r\n<h1 class=\"text-center\">the sub-title for this video is available</h1>\r\n<p>if you\'re not fully understand what I\'ve try to speak in the video as my accent is strongly Thai so let do this follow step</p>\r\n<ul class=\"list-group\">\r\n<li class=\"list-item\">\r\n<p>1. make sure that the \"video caption is on\"</p>\r\n<img class=\"responsive\" src=\"https://lh3.googleusercontent.com/_iiYCJK5alFrzdpx__pfIUlo8u5RMbB3HAtV30CaWeF45s0WqqvViIyiZRyfMfUu5JTJlXKxgBIbDeewtQLMtGXnn8XXMy8uZApHVY_T1aYDP9mU5kB9DGnDcH9XrraRNSprg6_ecac=w2400\" /></li>\r\n<!--item 2-->\r\n<li class=\"list-item\">\r\n<p>2. click on the \"setting\"</p>\r\n<img class=\"responsive\" src=\"https://lh3.googleusercontent.com/lKj1JRstB1uzuwktcv8EVZK2qlRj-9JLgGYbXGuzGknGPavkzEzA2TAW_Uc9PWuqDsBCZF1J18JdjDquiymwnV8zlQtFIVNlE-q5ob0TjcNkLw80EF-bBcCWrw7aegKFA24PkqUXkxI=w2400\" /></li>\r\n<!-- item 3-->\r\n<li class=\"list-item\">\r\n<p>3. select \"ENG\" (unless you want to read Thai)</p>\r\n<img class=\"responsive\" src=\"https://lh3.googleusercontent.com/V52rQvoFSVxAC_CPilZZfbv-Lth5y7qBqlo3f-8SvO6qJ2Dazbt8Dd8CN5nYPjvzMdrxR6Idx7rXpHIbXhIHhQUs4pxIxzvklmYukCvehcW_0OBoBjr1V365xdSaUEl04LbWPk1BAh4=w2400\" />\r\n<p class=\"pt-2\">and now you can read in English.</p>\r\n</li>\r\n</ul>\r\n</div>\r\n<!-- END OF ENG --> <!-- Section THAI -->\r\n<div class=\"col-lg-6\">\r\n<h1 class=\"text-center\">มีซับไตเติ้ลภาษาไทยนะครับ</h1>\r\n<p>ถ้าจะดูความหมายภาษาไทยก็ให้ท่านทำตามขั้นตอน ต่อไปนี้ครับ</p>\r\n<ul class=\"list-group\">\r\n<li class=\"list-item\">\r\n<p>1. ดูปุ่มแรกว่ามันเป็นสีแดงอยู่ข้างล่างหรือไม่ \"video caption is on\"</p>\r\n<img class=\"responsive\" src=\"https://lh3.googleusercontent.com/_iiYCJK5alFrzdpx__pfIUlo8u5RMbB3HAtV30CaWeF45s0WqqvViIyiZRyfMfUu5JTJlXKxgBIbDeewtQLMtGXnn8XXMy8uZApHVY_T1aYDP9mU5kB9DGnDcH9XrraRNSprg6_ecac=w2400\" /></li>\r\n<!--item 2-->\r\n<li class=\"list-item\">\r\n<p>2. คลิกที่ฟันเฟือง \"setting\"</p>\r\n<img class=\"responsive\" src=\"https://lh3.googleusercontent.com/lKj1JRstB1uzuwktcv8EVZK2qlRj-9JLgGYbXGuzGknGPavkzEzA2TAW_Uc9PWuqDsBCZF1J18JdjDquiymwnV8zlQtFIVNlE-q5ob0TjcNkLw80EF-bBcCWrw7aegKFA24PkqUXkxI=w2400\" /></li>\r\n<!-- item 3-->\r\n<li class=\"list-item\">\r\n<p>3. เลือกภาษา \"ไทย\" (หรือจะอ่านภาษาปะกิดก็เชิญ)</p>\r\n<img class=\"responsive\" src=\"https://lh3.googleusercontent.com/V52rQvoFSVxAC_CPilZZfbv-Lth5y7qBqlo3f-8SvO6qJ2Dazbt8Dd8CN5nYPjvzMdrxR6Idx7rXpHIbXhIHhQUs4pxIxzvklmYukCvehcW_0OBoBjr1V365xdSaUEl04LbWPk1BAh4=w2400\" />\r\n<p class=\"pt-2\">ได้แล้วใช่มั้ย</p>\r\n</li>\r\n</ul>\r\n</div>\r\n<!-- set sub title section as 2 column END--> <!-- END of Row2--></div>\r\n</div>', '2020-03-04 22:00:05', '2020-03-07 06:15:45', 14, 2, 2, 314, '173.252.95.113', '2020-07-27', 'far_yahoo', '1.47.235.254', 2);
INSERT INTO `tbl_article` (`ar_id`, `kw_id`, `uniq_id`, `cat_id`, `ar_summary`, `ar_title`, `ar_body`, `date_add`, `date_edit`, `ar_user_id`, `ar_show_public`, `ar_show_index`, `ar_read_count`, `last_view_ip`, `last_view_date`, `ar_post_by`, `ar_post_ip`, `ar_is_approve`) VALUES
(25, 26, 'O9F137D8C1MP8VBN4U62JRBTEEUFDA6G1EVYKADBD27ITJTY79TJXRD8CF32I3AAO8YPE3O4JY55DAI099R50LM9EPSDAIBOAAYBDGZ794Q20HTYR4CD894RJT4J27S65HUV7TP5KHYYSJF339E6V95PCJ2BC0FT8W44176H6U05', 8, '<!--summary start last edit 11-Aug-2020-->\r\n<section id=\"article_summary\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-md-4\"><img class=\"responsive\" src=\"https://upload.wikimedia.org/wikipedia/th/8/89/%E0%B8%88%E0%B8%AD%E0%B8%A1%E0%B8%9E%E0%B8%A3%E0%B8%B2%E0%B8%99.jpg\">\r\n                <p>เพชพระอุมา ตอน จอมพราน</p>\r\n            </div>\r\n            <div class=\"col-md-8\">\r\n                <h1>เพชรพระอุมา ตอน จอมพราน</h1>\r\n                <p class=\"text-center\"><strong> All Credit will be thanks to เครดิตให้ผู้เขียนนามปากกา \"พนมเทียน\" </strong> <a class=\"btn btn-primary btn-xs\" style=\"color: white; font-weight: bold;\" href=\"https://th.wikipedia.org/wiki/%E0%B9%80%E0%B8%9E%E0%B8%8A%E0%B8%A3%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B8%AD%E0%B8%B8%E0%B8%A1%E0%B8%B2\" target=\"_blank\" rel=\"noopener\">เพชรพระอุมาวิกิพีเดีย</a></p>\r\n                <p>&nbsp;</p>\r\n                <div style=\"margin: 0 auto; border: 2px dashed #ff0000;\">\r\n                    <p class=\"text-center\"><br><strong>ใช้เพื่อฟังส่วนตัวเท่านั้น!</strong> <span style=\"color: red; font-weight: bold;\"> ไม่ได้มีเจตนาละเมิดลิขสิทธิ์แต่อย่างใด </span></p>\r\n                </div>\r\n                <p>&nbsp;</p>\r\n                <p>ผู้ประพันธ์ นายฉัตรชัย วิเศษสุวรรณภูมิ (พนมเทียน)</p>\r\n                <p><strong> ตอน</strong> จอมพราน<br>หนังสือเสียง เพชรพระอุมา <br><strong>อ่านโดย </strong> ดวงวิภา ยุทธสุริยพันธุ์ <br>Edit Sound by Ubuntu 18.04 | Audacity | farookphuket | 5-Sep-2019</p>\r\n                <p>ภาคแรกของเพชรพระอุมาแบ่งเป็น 6 ตอน ได้แก่ ไพรมหากาฬ, ดงมรณะ,<br>จอมผีดิบมันตรัย, อาถรรพณ์นิทรานคร, ป่าโลกล้านปี และแงซายจอมจักรา</p>\r\n                <p>สำหรับภาคสมบูรณ์ก็แบ่งเป็น 6 ตอนเช่นกัน ได้แก่ จอมพราน,<br>ไอ้งาดำ, จิตรางคนางค์, นาคเทวี, แต่ปางบรรพ์ และมงกุฎไพร</p>\r\n                <p>\"เพชรพระอุมา\" เป็นบทประพันธ์ของ \"พนมเทียน\" มีความยาวทั้งสิ้น 48 เล่ม<br>แบ่งออกเป็นสองภาค คือภาคแรกและภาคสมบูรณ์ ภาคละ 24 เล่ม เล่มละ 200 บาท<br>สั่งซื้อได้ตามร้านหนังสือทั่วไป</p>\r\n                <p>ห้องสมุดคอลฟิลด์เพื่อคนตาบอด ของมูลนิธิช่วยคนตาบอดแห่งประเทศไทย <br>ในพระบรมราชินูปถัมภ์ ได้นำมาจัดทำเป็นหนังสือเสียงทั้งสองภาค</p>\r\n                <p>ภาคแรกมีอาสาสมัครช่วยกันอ่านสองท่าน คือ คุณศศวรรณ อรรถจรรยากุล<br>เริ่มอ่านจากตอนต้น ..ไพรมหากาฬ ต่อด้วย..ดงมรณะไปถึงช่วงกลางๆ<br>จากนั้นคุณดวงวิภา ยุทธสุริยพันธุ์ อ่านต่อในส่วนที่เหลือจนจบทั้งสองภาค</p>\r\n                <p><strong>Copy Form youtube&nbsp;&nbsp;</strong> <a class=\"btn btn-primary\" style=\"color: white; font-weight: bold;\" href=\"https://www.youtube.com/channel/UCBOdKk8Fb_lT1wQhu8ftCDw\" target=\"_blank\" rel=\"noopener\"> ร้อยตํารวจเอก ปลอมตัวมา </a> <br>Published on Dec 3, 2017</p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>\r\n<!-- End Of Summary -->', 'ฟังหนังสือเสียง,เพชรพระอุมา,ตอน จอมพราน', '<!-- BODY START -->\r\n<section id=\"article_body\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-4\"><img class=\"responsive\" src=\"https://upload.wikimedia.org/wikipedia/th/8/89/%E0%B8%88%E0%B8%AD%E0%B8%A1%E0%B8%9E%E0%B8%A3%E0%B8%B2%E0%B8%99.jpg\"></div>\r\n            <div class=\"col-lg-8\">\r\n                <h1 class=\"text-center\">เพชรพระอุมา ตอน จอมพราน 11-8-2020</h1>\r\n                <p>&nbsp;</p>\r\n                <p>&nbsp;</p>\r\n            </div>\r\n            <div class=\"col-lg-12\">\r\n                <p>&nbsp;</p>\r\n                <ol>\r\n                    <li>\r\n                        <h1 class=\"text-center\">คลิปเสียงที่ 1 ถึง 8</h1>\r\n                        <p>&nbsp;</p>\r\n                        <p><iframe src=\"https://archive.org/embed/2-jom-pran-1-to-8\" allowfullscreen=\"allowfullscreen\" width=\"500\" height=\"30\" frameborder=\"0\"></iframe></p>\r\n\r\n                        <p>ความยาว 8 ชั่วโมง 16 นาที 53 วินาที</p>\r\n                        <p>&nbsp;</p>\r\n                    </li>\r\n\r\n\r\n\r\n\r\n                    <!--\r\n                    <li>\r\n                        <div class=\"container\">\r\n                            <p>&nbsp;<br></p>\r\n                            <h1 class=\"text-center\">คลิปเสียงที่ 225 - 230</h1>\r\n                            <p>&nbsp;<br></p>\r\n                            <p><iframe src=\"https://archive.org/embed/225-to-230\" allowfullscreen=\"allowfullscreen\" width=\"500\" height=\"30\" frameborder=\"0\"></iframe><br></p>\r\n                            <p>ความยาว 7 ชั่วโมง 27 นาที 51 วินาที</p>\r\n                        </div>\r\n                    </li>\r\n                    <li>\r\n                        <div class=\"container\">\r\n                            <p>&nbsp;<br></p>\r\n                            <h1 class=\"text-center\">คลิปเสียงที่ 231 - 237</h1>\r\n                            <p>&nbsp;<br></p>\r\n                            <p><iframe src=\"https://archive.org/embed/231-to-237\" allowfullscreen=\"allowfullscreen\" width=\"500\" height=\"30\" frameborder=\"0\"></iframe><br></p>\r\n                            <p>ความยาว 8 ชั่วโมง 09 นาที 10 วินาที</p>\r\n                        </div>\r\n                    </li>\r\n                    <li>\r\n                        <div class=\"container\">\r\n                            <h1 class=\"text-center\">คลิปเสียงที่ 238 - 244</h1>\r\n                            <p><iframe src=\"https://archive.org/embed/238to244\" allowfullscreen=\"allowfullscreen\" width=\"500\" height=\"30\" frameborder=\"0\"></iframe><br></p>\r\n                            <p>ความยาว 8 ชั่วโมง 11 นาที 54 วินาที</p>\r\n                        </div>\r\n                    </li>\r\n                    <li>\r\n                        <div class=\"container\">\r\n                            <h1 class=\"text-center\">คลิปเสียงที่ 245 - 249</h1>\r\n                            <p><iframe src=\"https://archive.org/embed/245to249\" allowfullscreen=\"allowfullscreen\" width=\"500\" height=\"30\" frameborder=\"0\"></iframe><br></p>\r\n                            <p>ความยาว 6 ชั่วโมง 17 นาที 54 วินาที</p>\r\n                        </div>\r\n                    </li>\r\n                    <li>\r\n                        <div class=\"container\">\r\n                            <h1 class=\"text-center\">คลิปเสียงที่ 250 - 257</h1>\r\n                            <p><iframe src=\"https://archive.org/embed/250-to-257\" allowfullscreen=\"allowfullscreen\" width=\"500\" height=\"30\" frameborder=\"0\"></iframe><br></p>\r\n                            <p>ความยาว 8 ชั่วโมง 18 นาที 18 วินาที</p>\r\n                        </div>\r\n                    </li>\r\n                    -->\r\n                </ol>\r\n                <p>เดี๋ยวคลิปที่เหลือผมจะทยอย update ให้ น่าจะอาทิตย์หน้า( 20-8-2020)นะครับ</p>\r\n                <!--\r\n                <p>จบตอน \"จอมพราน\" แล้วล่ะครับ ซึ่งตัวผมเอง ผมก็ไม่รู้ว่ามันขาดไปตอนไหนบ้าง ถ้ามันขาดไป และแฟนๆ นิยายเรื่องนี้ท่านใด มีไฟล์เสียงก็ขอความอนุเคราะห์ด้วยครับ </p>\r\n                -->\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>\r\n<!-- END BODY -->', '2020-08-11 11:47:01', '2020-08-11 11:47:01', 14, 2, 2, 0, '', '0000-00-00', 'far_yahoo', '127.0.0.1', 2);
