(6, '6Q4NJB7TIEDS38B92L20O98TJAYMA9GEUHRIEY47AIVZC4IT82HY75C5DHG4P66D4KJ3WPAS0MYT', 0, 22, '2019-09-24 20:42:33', '2019-09-24 20:42:33', 0, 2, 0, ' Event Create by root on 9/24/2019, 8:28:31 PM', '', '<div class=\"card\">\r\n<div class=\"card-header\">\r\n<h1 class=\"text-center\">last update on 9/24/2019, 8:28:31 PM</h1>\r\n</div>\r\n<div class=\"card-body\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-4\"><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/FM2j-cPcb92M0lI8ccOOPKKdYWESARD6QR_zCkewRGxLiDFYn5-JuKNP2ltFI1Lc4e96whUfPY8qFz9CP4heg5oXcHnxND4PXUeoz__Lv8Zh9WSshBGyG6fW4_1soMqeascWmK4wS9Y=w2400\" />\r\n<p class=\"text-center\">Update today 24-Sep-2019</p>\r\n</div>\r\n<div class=\"col-lg-8\">\r\n<p>@BUU Sakaew มบูฯ ที่รัก</p>\r\n<ol>\r\n<li>edit \"Admin\" article</li>\r\n</ol>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"card-footer\">\r\n<p class=\"alert alert-info\">Event Create by root on 9/24/2019, 8:28:31 PM</p>\r\n</div>\r\n</div>'),
(7, '69EJZNBTTAHBJTSUXK9S86RCA9W3I0D2RJJ32H8DAA4OHIFJY57I0D5CG4QBY2T74S5JAPVYMYPD', 13, 14, '2019-11-22 06:01:49', '2020-03-16 14:11:20', 0, 2, 0, 'วันนี้(22-11-2562) ต้อขอโทษแฟนๆ นิยาย', '<div class=\"card\">\r\n<div class=\"card-header\">\r\n<h1 class=\"text-center\">วันนี้(22-11-2562) ต้องขอโทษแฟนๆ นิยาย เพชรพระอุมา ทุกๆ คนด้วยครับ</h1>\r\n</div>\r\n<div class=\"card-body\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-4\"><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/8hFdCP9chjc1UWcwhxaQF3tn68hjfAae4hBMmwkjstcaxB-qHnmpao7Nzx3cBSB7SVRpFShI-mAV2zkh5ft-HGARJcE1VK1ZMXaRw6LPF0Tw4KuCZS5T4ZqBkIvGGOwQiGgI35jLWZg=w2400\" />\r\n<p class=\"text-center\">ขอโทษด้วยนะครับ Link ทั้งหมดโดนลบแล้ว</p>\r\n</div>\r\n<div class=\"col-lg-8\">\r\n<p>ผมไม่สามารถหา Link \"นิยายเพชรพระอุมา\" มาแชร์ให้ทุกๆ ท่านแฟนๆ หนังสือนิยายได้ฟังกันแล้วล่ะครับ เพราะเดี๋ยวจะถูกพวก \"ลิขสิทธ์\" ฟ้องเอาเงินจากผม ไม่ก็เอาผมไปนอนคุกได้ ยิ่งไม่มีความรู้เรื่องกฎหมายคนพวกนี้หัวหมอดีมากครับ เพื่อความปลอดภัยของตัวผมเอง ผมขอลบโพสทั้งหมดภายในเร็ววันนี้ครับ</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"card-footer\">\r\n<p class=\"alert alert-info\">ขอลบโพสที่เกี่ยวกับหนังสือนิยาย \"เพขรพระอุมา\" ออกจากระบบทั้งหมด</p>\r\n</div>\r\n</div>', ''),
(8, '4KR76DDR1LYBABU76TC9SJY3YG585IDJ2HFX9EP80M3AEJTM8FJ44JJZYJAOTS49VD59BJSDW2HI', 13, 14, '2019-12-01 09:35:00', '2020-03-16 14:27:22', 0, 2, 0, 'my first time take a look of \"MX Linux\"', '<div class=\"card\">\r\n<div class=\"card-header\">\r\n<h1 class=\"text-center\">my first time take a look of \"MX Linux\"</h1>\r\n</div>\r\n<div class=\"card-body\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-4\"><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/ABX3ni7kzI7N3nfdD-3bZIvEkSY9kBOAVp1pp7UyUxLT_XTsbBS9uDPsTva4kzU0n4AUXUjEwwl7LhBIfu5EndRTjW6GdRbAW2Rkomdr8BCeI2dD99BkXMIabVVFbf2l4sxStZW6568=w2400\" />\r\n<p class=\"text-center\">My first tried on \"MX Linux\" was so so impress!!</p>\r\n</div>\r\n<div class=\"col-lg-8\">\r\n<p>I have never try \"MX Linux\" before in the past year and I never know why but today I saw one of the vedio on the youtube chanel it is really really make me feel like I have to give it a try on this distro so that\'\'s why I did it today. it is great so far.</p>\r\n<p>for any one who want to download the iso image to try just go ahead and do that by click on the link below<br /><a href=\"https://mxlinux.org/wiki/system/iso-download-mirrors/\" target=\"_blank\" rel=\"noopener\">DOWNLOAD ISO of MX Linux</a><br />just choose the server close to your home.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"card-footer\">\r\n<p class=\"alert alert-info\">my first time take a look of \"MX Linux\" on 1-Dec-2019</p>\r\n</div>\r\n</div>', '<div class=\"card\">\r\n<div class=\"card-header\">\r\n<h1 class=\"text-center\">my first time take a look of \"MX Linux\"</h1>\r\n</div>\r\n<div class=\"card-body\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-4\"><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/ABX3ni7kzI7N3nfdD-3bZIvEkSY9kBOAVp1pp7UyUxLT_XTsbBS9uDPsTva4kzU0n4AUXUjEwwl7LhBIfu5EndRTjW6GdRbAW2Rkomdr8BCeI2dD99BkXMIabVVFbf2l4sxStZW6568=w2400\" />\r\n<p class=\"text-center\">My first tried on \"MX Linux\" was so so impress!!</p>\r\n</div>\r\n<div class=\"col-lg-8\">\r\n<p>I have never try \"MX Linux\" before in the past year and I never know why but today I saw one of the vedio on the youtube chanel it is really really make me feel like I have to give it a try on this distro so that\'\'s why I did it today. it is great so far.</p>\r\n<p>for any one who want to download the iso image to try just go ahead and do that by click on the link below<br /><a href=\"https://mxlinux.org/wiki/system/iso-download-mirrors/\" target=\"_blank\" rel=\"noopener\">DOWNLOAD ISO of MX Linux</a><br />just choose the server close to your home.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"card-footer\">\r\n<p class=\"alert alert-info\">my first time take a look of \"MX Linux\" on 1-Dec-2019</p>\r\n</div>\r\n</div>'),
(9, '4C2JIBWAH7BY07YT6FUG759PXJYJ4S2Z136G6AJJHEHS30MD54OYD9F4SKIT8TR9D3J7ID8LDTJI', 0, 14, '2019-12-23 08:13:32', '2019-12-23 08:26:53', 0, 2, 0, 'ภาษิตว่า \"กันไว้ดีกว่าแก้ อย่ารอให้มันแย่เดี๋ยวมันจะแก้ยาก\"', '', '<div class=\"card\">\r\n<div class=\"card-header\">\r\n<h1 class=\"text-center\">ภาษิตว่า \"กันไว้ดีกว่าแก้ อย่ารอให้มันแย่เดี๋ยวมันจะแก้ยาก\"</h1>\r\n<p>อ่านดีๆ แล้วพี่จะรู้ว่า \"เงินมันหายาก\" ถ้าจะให้ดี อย่ารอให้มีปัญหาดีกว่า</p>\r\n</div>\r\n<div class=\"card-body\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-4\"><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/-rWfK9cAuGh8rI-19acWJ-XqBZ02DfKzqqAk9eWYGmDYSKacsumHhlDU20WMl1o4lopfcdm1FrRe0u0OkknaC7OTdPcOxoADaToexVOXYU17-ZmmYvS7NutxKPg-Ey0TF-sr318nadg=w1920-h1080\" />\r\n<p class=\"text-center\">ผมต้องลบโพสทั้งหมดเพราะเรื่องนี้แหละครับ</p>\r\n</div>\r\n<div class=\"col-lg-8\">\r\n<h2 class=\"text-center\">วันนี้ (23 ธันวาคม 2562) โพสที่เกี่ยวข้องกับหนังสือนิยาย \"เพชรพระอุมา\" ไม่สามารถเข้าดูได้อีกแล้ว</h2>\r\n<p>เหตุที่ผมจำเป็นจะต้องลบโพสทั้งหลายที่ \"เกี่ยวข้อง\" หรือ \"หมิ่นเหม่\" ต่อการกระทำผิดกฎหมาย เนื่องจากว่าผมได้เห็นข่าวในทีวี หรือ บทความตามเวปต่างๆ ว่าด้วยเรื่องการ \"ละเมิดลิขสิทธิ์ทรัพย์สินทางปัญญา\" ผมจึงกลัวว่าสักวันใดก็วันหนึ่งนั้น เรื่องนี้มันอาจจะเกิดขึ้นกับตัวผมเอง ผมจึงจำเป็นต้องกันตัวเองไว้ก่อน ได้โปรดอย่าเข้าใจผิดนะครับ แต่อยากให้ลองอ่านลิ้งค์สักนิดนึง <br /> ปล. <br /> ต่อให้ผมชอบแก้(ผ้าตอนอยู่กับคุณสาวๆ สองคน) มากแค่ไหน แต่เรื่อง \"แก้ปัญหา\" บอกเลย ผมไม่ถนัด ผมจึงไม่อยากให้รอจนตัวเองต้องมีปัญหาไงครับ</p>\r\n<p>จาก newtv.com : <strong> <a href=\"https://www.newtv.co.th/news/12489\" target=\"_blank\"> คลิกเพื่ออ่าน </a> </strong></p>\r\n<p>จาก วิกิพีเดีย ว่าด้วยเรื่อง พรบ. ลิขสิทธิ์ทรัพย์สินทางปัญญา <strong> <a href=\"https://th.wikipedia.org/wiki/%E0%B8%81%E0%B8%8E%E0%B8%AB%E0%B8%A1%E0%B8%B2%E0%B8%A2%E0%B8%A5%E0%B8%B4%E0%B8%82%E0%B8%AA%E0%B8%B4%E0%B8%97%E0%B8%98%E0%B8%B4%E0%B9%8C%E0%B9%84%E0%B8%97%E0%B8%A2\" target=\"_blank\"> คลิกเพื่ออ่าน </a> </strong></p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"card-footer\">\r\n<p class=\"alert alert-info\">ภาษิตว่า \"กันไว้ดีกว่าแก้ อย่ารอให้มันแย่เดี๋ยวมันจะแก้ยาก\"</p>\r\n</div>\r\n</div>'),
(10, '28Y7TUDHGTJETBMBD7PRJ962759IXSFGIV3YJCY26LAJAS44H3D5JEAJQ04D94OZYDR4A5KKJ8JT', 13, 14, '2020-01-21 08:06:35', '2020-03-16 14:24:39', 0, 2, 0, 'ข้อความถึงเพื่อนๆ ที่รักทุกท่าน', '<section class=\"st_sum\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-4\"><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/oErQwfNFUQbw82vxWa28GyQlqoeAn8u-cU_8PUr9oR45-eRW7vPvDxzEARUihxWnALM9sA27oCcdTK_HsCveyNeLowsjlL4E_p8cVsn8Ru8QMisOG36bVXGeAefj14Sfx11YCGq0bnQ=w2400\" />\r\n<p class=\"text-center\">กินให้อิ่ม นอนให้หลับ มีแรงก็ ตับๆ ตับๆ กันไป</p>\r\n</div>\r\n<div class=\"col-lg-8\">\r\n<p>ข้อความถึงทุกๆ ท่าน ผมเขียนข้อความนี้เมื่อวันที่ 21 เดือน มกราคม พ.ศ. 2563 <br />ผมไม่สามารถหา Link \"หนังสือเพชรพระอุมา\" มาโพสให้ทุกๆ ท่านได้เนื่องด้วยกลัวโดนละเมิดลิขสิทธิ์ ผมไม่อยากติดคุกหรือจ่ายค่าปรับเพราะว่าผมไม่มีเงิน อีกทั้งผมไม่อยากให้เวปไซต์หรือ บล๊อคที่ผมทำขึ้นมาต้องโดนปิดหากว่าเมื่อใดก็ตามที่เจ้าของลิขสิทธิ์หรือผู้มีอำนาจแทนมาพบและแจ้งความดำเนินคดีทางกฎหมายกับผม ผมไม่อยากเดือดร้อนครับ ซึ่งต่อให้ผมไม่ได้ทำเพื่อเอากำไรจากสิ่งที่ผมแชร์ไปนั้น แต่ทางเจ้าของลิขสิทธิ์ก้มีสิทธิ์อย่างเต็มที่ ที่จะฟ้องผมได้ และไม่ว่าจะทำอย่างไรผมก็ไม่มีข้ออ้างใดๆ เลยหากเกิดเรื่องขึ้นมา คือผมต้องชดใช้ค่าเสียหายคนเดียว ดังนั้นขอให้ทุกๆ ท่านโปรดเข้าใจและเมตตา ทั้งนี้ผมได้ลบโพสต่างๆ ที่เกี่ยวกับหนังสือ \"เพชรพระอุมา\" ไปจนหมดแล้ว(หากยังจะมีอยู่ก็คือ cache ของระบบซึ่งผมไม่สามารถลบเองได้ แต่มันก็จะโดนลบไปในที่สุด)</p>\r\n<p><strong>หาก</strong>ว่าท่านยังจะดึงดันอยากจะมี อยากจะได้ อยากจะแบ่งปันกัน เรามาทำแบบนี้กันมั้ยครับ คือ เราทุกๆ คนช่วยกันอุดหนุนผู้เขียนโดยการซื้อหนังสือของเค้า เพื่อเป็นการขออนุญาติเค้าในฐานะของแฟนหนังสือ และสนับสนุนคนที่อ่านหนังสือเล่มนี้ทั้งสองท่าน (คือ คุณศศวรรณ อรรถจรรยากุล และ คุณดวงวิภา ยุทธสุริยพันธุ์) โดยให้เงินแก่ท่านเหล่านั้นคนละสักเท่าไหร่ (ค่าหนังสือ 48คูณ200 เท่ากับ 9600 บาท เราจ่ายให้ผู้อ่านคนละ 1000 บาท) ผมว่าท่านเหล่านั้นเค้าน่าจะยอมให้ ในฐานะที่เราเป็นคนไทยด้วยกัน ลองคิดดูกันเล่นๆ นะครับ ว่าคุณลุง พนมเทียน แกเขียนหนังสือนิยายเรื่องนี้มาตั้งหลายปีแต่พวกเราใช้เวลาแค่ไม่กี่วันในการก๊อปปี้ผลงานของแกคิดแล้วมันท้อนะครับ นี่แหละเค้าถึงต้องมีกฎหมายคุ้มครองสิทธิ์ของผู้ผลิต เพราะว่าถ้าทำออกมาแล้วไม่ได้ค่าเหนื่อยเป็นคุณๆ จะยอมมั้ย คำตอบก็คือ \"ไม่\" อย่างแน่นอนใครมันอยากจะเหนื่อยเปล่าๆ เล่า เพราะฉะนั้นเพื่อความแฟร์ๆ กันทั้งสองฝ่าย เรามาซื้อหนังสือเค้าก่อนดีกว่า (ผมซื้อหมดแล้วครับ 48 เล่ม แต่ยังไม่เคยได้ให้เงินกับผู้อ่านเลยเพราะว่าไม่รู้จะติดต่อเค้ายังไง เผื่อใครพอจะรู้ก็แชร์ต่อๆ กันไปนะครับ) ผมยินดีที่จะทำคลิปเสียงเหล่านี้ครับถ้าหากว่าผมสามารถหาไฟล์เสียงได้ และได้รับความยินยอมจากท่านเหล่านั้นโดยทางกฎหมาย <br />แต่ตอนนี้คือไฟล์เสียงที่ผมก๊อปปี้มาจาก youtube มันโดน Ban ไปหมดแล้ว แต่ถ้าหากพวกเราทุกๆ คนที่เป็นแฟนหนังสือของ \"ลุงพนมเทียน\" ไปช่วยกันอุดหนุนท่านและช่วยกันขอร้องท่าน ผมว่ามันไม่ยากหรอกครับ พวกเราแค่อยากเก็บผลงานที่แสนสุดยอดนี้เอาไว้ให้ลูกหลานคนรุ่นหลังได้เห็นถึงความอัจริยะของผู้ประพันธ์เท่านั้น ไม่ได้มีเจตนาจะมาทำกำไรจากผลงานของท่าน ท่านคงยอม</p>\r\n<p>ผมรู้หรอกครับว่า ผมก็คงได้แค่โพสไร้สาระไปงั้นแหละ ใครที่ไหนมันจะ \"บ้า\" จ่ายเงินหมื่นกว่าบาทซื้อหนังสือหรือให้คนอ่านกันล่ะ ถ้าเค้าสามารถหามันมาได้แบบฟรีๆ ลืมมันไปเถอะครับ ผมขออยู่เฉยๆ แบบ \"ไม่เสี่ยงผิดกฎหมาย\" ของผมดีกว่า ไม่อยากเดือดร้อนครับ <br />โชคดี สำลีแปะหัวกันถ้วนหน้าทุกคนครับ สวัสดี</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>', '<div class=\"card\">\r\n<div class=\"card-header\">\r\n<h1 class=\"text-center\">ข้อความถึงเพื่อนๆ ที่รักทุกท่าน</h1>\r\n</div>\r\n<div class=\"card-body\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-4\"><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/oErQwfNFUQbw82vxWa28GyQlqoeAn8u-cU_8PUr9oR45-eRW7vPvDxzEARUihxWnALM9sA27oCcdTK_HsCveyNeLowsjlL4E_p8cVsn8Ru8QMisOG36bVXGeAefj14Sfx11YCGq0bnQ=w2400\" />\r\n<p class=\"text-center\">กินให้อิ่ม นอนให้หลับ มีแรงก็ ตับๆ ตับๆ กันไป</p>\r\n</div>\r\n<div class=\"col-lg-8\">\r\n<p>ข้อความถึงทุกๆ ท่าน ผมเขียนข้อความนี้เมื่อวันที่ 21 เดือน มกราคม พ.ศ. 2563 <br />ผมไม่สามารถหา Link \"หนังสือเพชรพระอุมา\" มาโพสให้ทุกๆ ท่านได้เนื่องด้วยกลัวโดนละเมิดลิขสิท