ยอดนี้เอาไว้ให้ลูกหลานคนรุ่นหลังได้เห็นถึงความอัจริยะของผู้ประพันธ์เท่านั้น ไม่ได้มีเจตนาจะมาทำกำไรจากผลงานของท่าน ท่านคงยอม</p>\r\n<p>ผมรู้หรอกครับว่า ผมก็คงได้แค่โพสไร้สาระไปงั้นแหละ ใครที่ไหนมันจะ \"บ้า\" จ่ายเงินหมื่นกว่าบาทซื้อหนังสือหรือให้คนอ่านกันล่ะ ถ้าเค้าสามารถหามันมาได้แบบฟรีๆ ลืมมันไปเถอะครับ ผมขออยู่เฉยๆ แบบ \"ไม่เสี่ยงผิดกฎหมาย\" ของผมดีกว่า ไม่อยากเดือดร้อนครับ <br />โชคดี สำลีแปะหัวกันถ้วนหน้าทุกคนครับ สวัสดี</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"card-footer\">\r\n<p class=\"alert alert-info\">ข้อความถึงเพื่อนๆ ที่รักทุกท่าน</p>\r\n</div>\r\n</div>'),
(11, 'U7ULMS1K5AG28OCRRP834CTBGW6YB8HFDIUMD82H993HAI0EUVV6DT9J46TJ0B529PI4TA37BD2R', 0, 72, '2020-02-19 06:32:45', '2020-02-19 06:33:47', 0, 2, 0, ' บังเอิญเห็น เลยเอามาฝาก ', '', '<div class=\"card\">\r\n<div class=\"card-header\">\r\n<h1 class=\"text-center\">บังเอิญเห็น เลยเอามาฝาก Event Create by พี่เบิ้ม on 2/19/2020, 6:01:12 AM</h1>\r\n</div>\r\n<div class=\"card-body\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-4\"><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/8KtecAxEYMdJjG2A4eSxA8kCQJZqjwYWV-_oGhQklPESUCPz_f6WUndv4jvH-IAax8VvYpqRbgHSpZYP4qgjvOiYAvxAwdzGGUxiOKe6yQ9UWmGx8XM6ccx_gJTLUIj_pXL9xJuI8Ec=w2400\" />\r\n<p class=\"text-center\">ใครรู้เรื่องนี้ช่วยบอกหน่อยนะครับ</p>\r\n</div>\r\n<div class=\"col-lg-8\">\r\n<p>พอดีไปเห็นคลิปนี้มา เลยอยากเอามาฝาก เห็นว่ามันเป็นกรณีเดียวกับของเราเลย</p>\r\n<p style=\"text-align: right; color: red; font-weight: bold;\">ผมไม่ได้เอามาใช้ในทางหากำไรจาก Content เหล่านั้นเลย</p>\r\n<p class=\"pt-4\">&nbsp;</p>\r\n<div class=\"video-container\"><iframe src=\"https://www.youtube.com/embed/rzM8WJNvec8\" width=\"560\" height=\"315\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"card-footer\">\r\n<p class=\"alert alert-info\">บังเอิญเห็น เลยเอามาฝาก Event Create by พี่เบิ้ม on 2/19/2020, 6:01:12 AM</p>\r\n</div>\r\n</div>'),
(12, 'FBKDK615BMBV937099JVY5UJ0VBTJVDCHL2D7EOPATEN64ACDY7R61CJG23YJ7YO25D5488UI3R6', 13, 14, '2020-03-14 21:04:36', '2020-03-16 14:15:26', 0, 2, 0, 'เรื่องบ้าบ่น', '<div class=\"card\">\r\n<div class=\"card-header\">\r\n<h1 class=\"text-center\">เรื่องบ้าบ่น</h1>\r\n</div>\r\n<div class=\"card-body\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-4\"><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/nERmzqJu1k1S7BVh6vBjkTYjmO_ONEp95aSbre7aPalygEXRDUasWfY4xpp3H3Me85I-2Zn4L6H_79_4CY6l9arQcoPpxNr03meB7OXitJ2G7YGmCndZxk3EqTwJBTWSRBNyNWbSOSM=w2400\" />\r\n<p class=\"text-center\">ผมว่าใช้ไลน์โมบาย เนตถูกกว่าเยอะเลย ดีกว่าด้วยนะ</p>\r\n</div>\r\n<div class=\"col-lg-8\">\r\n<h1 class=\"text-center\">โดนอีกแล้ว กูล่ะเซ็ง</h1>\r\n<p>วันนี้ (14-Mar-2020) พอดีเห็นว่า เนตเบอร์ทรูมันใช้ไป 10 กิ๊กแล้วจาก 16GB/เดือน วันนี้พอดีเห็นมันโฆษณาเนตดีแทค ไม่จำกัดต่อเดือนแบบเติมเงิน ราคา 300 กว่าๆ ได้เนตความเร็ว 2Mbps. เลยจัดมา สรุปว่า เสียเงิน เสียเวลา กูล่ะเซ็ง แม่งดูยูทูปก็ไม่ได้ หมุนติ้วๆ ไอ้ชิบหาย</p>\r\n</div>\r\n<!-- video START -->\r\n<div class=\"container\">\r\n<h2 class=\"text-center\">ชั่วโมงนี้ Line Mobile ถูกและดี(สำหรับผม) ที่สุดแล้วครับ</h2>\r\n<p>รักเธอ Line Mobile 400 กว่าก็พอได้ใช้นะ แค่ 40 กิ๊กก็โอเค</p>\r\n<p class=\"pt-4\">&nbsp;</p>\r\n<div class=\"video-container\"><iframe src=\"https://www.youtube.com/embed/8Duo_bebc7Y\" width=\"560\" height=\"315\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n<p class=\"pt-4\">&nbsp;</p>\r\n<p>ถ้าท่านอยากสนับสนุนผมก็ คลิกลิ้งค์ด้านล่างนี้ครับ<br /><a class=\"btn btn-primary\" href=\"https://finnmobile.io/th/packages?utm_campaign=user_referral_program&amp;utm_medium=user_ref_link&amp;utm_source=finn_mobile_user\" target=\"_blank\" rel=\"noopener\">Support Me ช่วยผม 10 บาทครับ</a></p>\r\n</div>\r\n<!-- END Video --></div>\r\n</div>\r\n<div class=\"card-footer\">\r\n<p class=\"alert alert-info\">เรื่องบ้าบ่น Dtac แพงเหี้ยๆ แถมเนตห่วย</p>\r\n</div>\r\n</div>', ''),
(15, 'T24V6VYPYLTP6YMVO6GAK1243DH73X479FAU70CYCTROHB23J51N8UTBHQ9RB9056FAEFR4U5B2D', 13, 14, '2020-03-24 20:30:44', '2020-03-24 20:30:44', 0, 2, 0, 'The firefox browser cannot play the embeded youtube video', '<section id=\"ustd_sum\">\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-4\"><img class=\"responsive\" src=\"https://lh3.googleusercontent.com/9X9WMPXucvu-LCemaBhM-1AaXDzvt0V3ZKt3vRs_hu-MtWhgxU4y_5JeRh0TLca6wydXR6TlsHXHg71v6iCVZGDnNxjntLXYBq1GMUEQhEb9o9UiDq6XztWlg8V724sUiGpsy_IokBA=w2400\">\r\n                <p class=\"text-center\">firefox could not play the embeded video from youtube</p>\r\n            </div>\r\n            <div class=\"col-lg-8\">\r\n                <h1 class=\"text-center\">Firefox browser cannot play the embeded video 24-Mar-2020 </h1>\r\n                <p>Today(24-Mar-2020) in this&nbsp;morning I tried to watch the video I\'ve embed from youtube with the firefox web browser and it is not play properly it is always show error (as it shown in image) in everytime when I try to do so. to play the video embed from youtube now use the Google Chrome instead.</p>\r\n                <p>I do not know how to fix this so far but I hope I will find the solution soon.</p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>', ''),
(16, 'OT2AK7J386656002ABXY9UAFCRA255987D304I9EHD2RKEQYTET3J1E89A095CJG67IPJR25HYTH', 13, 14, '2020-04-04 19:46:44', '2020-04-04 19:46:44', 0, 2, 0, '\"กูไม่รู้กูอยู่ต่างประเทศ\" กูรวยมาก', '<section>\r\n    <div class=\"container\">\r\n        <div class=\"row\">\r\n            <div class=\"col-lg-4\">\r\n\r\n                <div class=\"video-container\">\r\n                    <iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/Kejy7_CoOJc\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\"></iframe>\r\n                </div>\r\n                <p class=\"text-center\">ทนายเดชารู้ทัน คนเห็นแก่ตัว</p>\r\n            </div>\r\n            <div class=\"col-lg-8\">\r\n                <h1 class=\"text-center\">กูไม่รู้ กูเพิ่งกลับมา</h1>\r\n                <p>แต่จริงๆ กูแค่รวยมาก พ่อกูเส้นใหญ่ กฎหมายไทยต้องหยวนๆ ให้คนพวกนี้ บ้านเราคนรวยเยอะ คนใหญ่คนโตที่กฎหมายทำอะไรไม่ได้ พวกนักเรียนนอก ไม่ยอมรับการปกครอง เรามาดูกันมั้ยว่า กฎหมายบ้านเราจะสามารถทำอะไรคนแบบนี้ได้บ้าง ไหนบอกว่าโทษหนัก ปรับ 4 หมื่น จำคุก 2 ปี มันจะสามารถทำอะไรคนเหล่านี้ได้บ้าง เราต่างก็รู้ดีกันอยู่แล้วว่า บ้านเรากฎหมายศักดิ์สิทธิ์มาก เห็นได้จากความสงบ ไม่มีข่าวฆ่ากันตาย ไม่มีข่าวข่มขืนเลยแม้แต่น้อย&nbsp;</p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>', '<section>\r\n    <div class=\"alert alert-danger\">\r\n        <h1 class=\"text-center\">No need the content here</h1>\r\n        <p>As it is a short post</p>\r\n    </div>\r\n</section>');
